    private void jButton1ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton1ActionPerformed

    double Nb = Double.parseDouble(j1.getText());
    double c = Double.parseDouble(j2.getText());
    double R = Double.parseDouble(j3.getText());
    double O = Double.parseDouble(j4.getText());
    
    double x1 = Math.pow(Nb,(0.66));
    double x2 = Math.pow(R,(1.3));
    double x3 = Math.pow((O*R) , (0.67));
    
    double WbM=(0.448)*((0.026)*x1*c*x2*x3); //Ana Rotor Palaları
   
    String s=String.valueOf(WbM);
    j5.setText(s); 

    //---------------------------------------------------------------
    
    double g = Double.parseDouble(j6.getText());
    double J = Double.parseDouble(j7.getText());
    x1 = Math.pow(Nb,(0.28));
    x2 = Math.pow(R,(1.5));
    x3 = Math.pow((O*R) , (0.43));
    double x4= Math.pow(R,2);
    double x5= Math.pow( ((0.67)*WbM + ((g*J)/x4)) , (0.55));
    
    double WhM=(0.448)*((0.0037)*x1*x2*x3*x5); //Ana Rotor Göbek Ve Menteşeler
   
    String s1=String.valueOf(WhM);
    j8.setText(s1); 
    
    
    
    //---------------------------------------------------------------
    
    double AH = Double.parseDouble(j9.getText());
    double BH = Double.parseDouble(j10.getText());
    
    
    x1 = Math.pow(AH,(1.2));
    x2 = Math.pow(BH,2);
    x3 = Math.pow((x2/AH) , (0.32));
    double WH=(0.448)*((0.072)*x1*x3); //Yatay Dengeleyici
   
    String s2=String.valueOf(WH);
    j11.setText(s2); 
    
    //---------------------------------------------------------------
    
    double AV = Double.parseDouble(j13.getText());
    double BV = Double.parseDouble(j14.getText());
    double kuyrukRotoruDisliSayisi = Double.parseDouble(j15.getText());
    
    x1 = Math.pow(AV,(0.94));
    x2 = Math.pow(BV,2);
    x3 = Math.pow((x2/AV) , (0.53));
    x4 = Math.pow((kuyrukRotoruDisliSayisi),(0.71));
    
    double WV=2*(4.448)*((1.05)*x1*x3*x4);  //Düşey Dengeleyici
    
    String s3 = String.valueOf(WV);
    j16.setText(s3);
    
    
    //---------------------------------------------------------------
    
    double Rt = Double.parseDouble(j17.getText());
    double maxGuc = Double.parseDouble(j18.getText());
    
    
    x1 = Math.pow(Rt,(0.09));
    
    double WTR = (4.448) * ((1.4)*x1*(maxGuc)/O);  //Kuyruk Rotoru
    
    String s4 = String.valueOf(WTR);
    j19.setText(s4);
    
    
    //---------------------------------------------------------------
    
    double WG = Double.parseDouble(j20.getText());
    double LF = Double.parseDouble(j21.getText());
    double SWet = Double.parseDouble(j22.getText());
    
    
    x1 = Math.pow((WG/1000),(0.49));
    x2 = Math.pow((LF),(0.61));
    x3 = Math.pow((SWet),(0.25));
    
    
    double WF = (4.448) * ((6.9)*x1*x2*x3) ;  //Gövde
    
    String s5 = String.valueOf(WF);
    j23.setText(s5);
    
    
    //---------------------------------------------------------------
    
    double tekerBacakSayisi = Double.parseDouble(j24.getText());
    
    x1 = Math.pow((WG/1000), (0.67));
    x2 = Math.pow((tekerBacakSayisi), (0.54));
    
    double WLG = (4.448)*(40*x1*x2)/6;      //İniş Takımı
    String s6 = String.valueOf(WLG);
    j25.setText(s6);
    
    
    //---------------------------------------------------------------
    
    double WEng = Double.parseDouble(j26.getText());
    double motorSayisi = Double.parseDouble(j27.getText());
    double SWetN = Double.parseDouble(j28.getText());
    
    
    x1 = Math.pow((WEng),(1.1));
    x2 = Math.pow((motorSayisi),(0.24));
    x3 = Math.pow((SWetN),(1.3));
    
    
    double WN = (4.448)* ((0.041)*x1*x2 + ((0.33)*x3));  //Motor Beşiği
    
    String s7 = String.valueOf(WN);
    j29.setText(s7);
    
    
    //---------------------------------------------------------------
    
    x1 = Math.pow((WEng),(0.59));
    x2 = Math.pow((motorSayisi),(0.2));
    
    double WPSS = (4.448)*(2*x1*x2)/2; //İtki Alt Sistemi
    
    String s8 = String.valueOf(WPSS);
    j30.setText(s8);
    
    
    //---------------------------------------------------------------
    
    double kapasite = Double.parseDouble(j31.getText());
    double tankSayisi = Double.parseDouble(j32.getText());
    
    
    
    x1 = Math.pow((kapasite),(0.77));
    x2 = Math.pow((tankSayisi),(0.59));
   
    
    
    double WFS = (4.448) * ((0.43)*x1*x2);  //Yakıt Sistemi
    
    String s9 = String.valueOf(WFS);
    j33.setText(s9);
    
    
    
    //---------------------------------------------------------------
    
    double THPR = Double.parseDouble(j34.getText());
    double rpmEng = Double.parseDouble(j35.getText());
    double TRHPR  = Double.parseDouble(j36.getText());
    double OM = Double.parseDouble(j37.getText());
    double OT = Double.parseDouble(j38.getText());
    double disliKutusuSayisi = Double.parseDouble(j39.getText());
    
    
    x1 = Math.pow((THPR),(0.82));
    x2 = Math.pow(((rpmEng)/1000),(0.037));
    x3 = Math.pow(((TRHPR*OM)/(THPR*OT)),(0.68));
    x4 = Math.pow((disliKutusuSayisi) , (0.066));
    x5 = Math.pow((OM) , (0.64));
    
    double WDS = (4.448) * ((13.6)*x1*x2*x3*(x4/x5) ) ;  //Aktarma Sistemi
    
    String s10 = String.valueOf(WDS);
    j40.setText(s10);
    
    //---------------------------------------------------------------
    
    x1 = Math.pow((WG/1000),(0.4));
    
    double WCC = (4.448)*((11.5)*x1);
    String s11 = String.valueOf(WCC);  //Kokpit Kontrolleri
    j41.setText(s11);
    
    
    //---------------------------------------------------------------
    
    x1 = Math.pow((c) , (2.2));
    x2 = Math.pow((O*R/1000) , (3.2));
    
    
    double WSC = (4.448) * (36*Nb*x1*x2)/2;   //Kontrol Sistemi
    String s12 = String.valueOf(WSC);
    j42.setText(s12);
    
    //---------------------------------------------------------------
    
    double WAPP = 667.2;           //Yardımcı Güç Ünitesi
    String s13 = String.valueOf(WAPP);
    j43.setText(s13);
    
    
    //---------------------------------------------------------------
    
    x1 = Math.pow((WG/1000) , (1.3));
    double WINS = (4.448)*((3.5)*(x1));           //Ekipmanlar
    String s14 = String.valueOf(WINS);
    j44.setText(s14);
    
    
    //---------------------------------------------------------------
    
    x1 = Math.pow((Nb) , (0.63));
    x2 = Math.pow((c) , (1.3));
    x3 = Math.pow((O*R/1000) , (2.1));
    
    double WHYD = (4.448)* (37*x1*x2*x3);           //Hidrolik Sistem
    String s15 = String.valueOf(WHYD);
    j45.setText(s15);
    
    
    //---------------------------------------------------------------
    
    x1 = Math.pow((THPR) , (0.65));
    x2 = Math.pow((WG/1000) , (0.4));      
                                   
    double WEL = (((4.448) * (((9.6)*x1))/(x2)) - WHYD)/15;     //Elektrik Sistemi      
    String s16 = String.valueOf(WEL);
    j46.setText(s16);
    
    
    //---------------------------------------------------------------
    
    double WMV = 4 * (WG/1000);     // İmalat Varyasyonu      
    String s17 = String.valueOf(WMV);
    j47.setText(s17);
    
    //---------------------------------------------------------------
    
    double WACAT = (WG/1000);     //İklimlendirme buzlanmaya karşı sistem      
    String s18 = String.valueOf(WACAT);
    j48.setText(s18);
    
    //---------------------------------------------------------------
    
    int aviyonikler = jComboBox1.getSelectedIndex();    //Aviyonikler
    
    int secim;
    String s19;
    if(aviyonikler==0){
        secim=222;
         s19= String.valueOf(secim);
        j49.setText(s19);
    }else if(aviyonikler==1){
        secim=667;
        s19 = String.valueOf(secim);
        j49.setText(s19);
    }else if (aviyonikler==2){
        secim=1780;
        s19 = String.valueOf(secim);
        j49.setText(s19);
    }
    
    //---------------------------------------------------------------
    
    int secim2 = jComboBox2.getSelectedIndex();    //Döşeme
    
    double doseme;
    
    String s20;
    if(secim2==0){
        x1 = Math.pow((WG/1000) , (1.3));
        doseme=(4.448)*6*x1;
        s20 = String.valueOf(doseme);
        j50.setText(s20);
    }else if(secim2==1){
        x1 = Math.pow((WG/1000) , (1.3));
        doseme=(4.448)*13*x1;
        s20 = String.valueOf(doseme);
        j50.setText(s20);
    }else if (secim2==2){
        x1 = Math.pow((WG/1000) , (1.3));
        doseme=(4.448)*23*x1;
        s20 = String.valueOf(doseme);
        j50.setText(s20);
    }
    
    double sec = Double.parseDouble(j49.getText());
    double dos = Double.parseDouble(j50.getText());
    
    //---------------------------------------------------------------
    double bosAgirlik =    (WbM+WhM+WH+WV+WTR+WF+WLG+WN+WPSS+WFS+WDS+WCC+WEng+
            WSC+WAPP+WINS+WHYD+WEL+WMV+WACAT+sec+dos)*(0.45359237) ;     // İmalat Varyasyonu      
    String a = String.valueOf(bosAgirlik);
    j51.setText(a);
    
    
    //nB = Double.parseDouble(jTextField1.getText());
        // TODO add your handling code here:
    }//GEN-LAST:event_jButton1ActionPerformed

